import React from 'react'
import "./home.css"
import Navbar from "./Navbar";
import Header from "./Header";
import Feature from "./Feature";
import Offer from "./Offer";
import About from "./About";
import Contact from "./Contact";

const Home = () => {
  return (
    <div>
      <Header/>
      <Navbar />
      <Header />
      <Feature />
      <Offer />
      <About />
      <Contact />
    </div>
  )
}

export default Home
